#include <stdio.h>
#include <stdbool.h>
#include <stdlib.h>

/* Cyclone V FPGA devices */
#define LEDR_BASE 0xFF200000
#define HEX3_HEX0_BASE 0xFF200020
#define HEX5_HEX4_BASE 0xFF200030
#define SW_BASE 0xFF200040
#define KEY_BASE 0xFF200050
#define TIMER_BASE 0xFF202000
#define PIXEL_BUF_CTRL_BASE 0xFF203020
#define CHAR_BUF_CTRL_BASE 0xFF203030

#define TITLE_SCREEN 0
#define IN_GAME 1
#define WINNER_A 2
#define WINNER_B 3

const int VGA_x = 320;
const int VGA_y = 240;

short int Buffer1[240][512];	  // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];
volatile int pixel_buffer_start;  // global variable

int gameState = TITLE_SCREEN;
void draw_titlescreen();

int main() {

	volatile int* KEY_PTR = (int*)KEY_BASE;

    // VGA SET UP
    volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
	// declare other variables(not shown)
	// initialize location and direction of rectangles(not shown)

	/* set front pixel buffer to Buffer 1 */
	*(pixel_ctrl_ptr + 1) =
		(int)&Buffer1;	// first store the address in the  back buffer
	/* now, swap the front/back buffers, to set the front buffer location */
	wait_for_vsync();

	/* initialize a pointer to the pixel buffer, used by drawing functions */
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen();	 // pixel_buffer_start points to the pixel buffer

	/* set back pixel buffer to Buffer 2 */
	*(pixel_ctrl_ptr + 1) = (int)&Buffer2;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);	 // we draw on the back buffer
	clear_screen();	 // pixel_buffer_start points to the pixel buffer

    // Draw title screen onto just one buffer to start.

	draw_titlescreen();	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr +1);	// pointing to next buffer, not drawing yet

    while (gameState == TITLE_SCREEN) {
		// wait for either 1 or 0 to be pressed
		if (*(KEY_PTR + 3) > 0) {	// poll edge cap
			printf("edge cap is high\n");
			*KEY_PTR = 1; //reset edge cap
			gameState = IN_GAME; 

			// Draw background for gameplay loop
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr +1);	// pointing to next buffer, not drawing yet
			clear_screen();	// erasing title screen
		}
    }

	while (gameState == IN_GAME) {
		printf("in game\n");
	}
}

void draw_titlescreen() {

	int counter = 0;

	for (int i = 0; i < TITLESCREEN_HEIGHT; i++) {
        
		for (int j = 0; j < TITLESCREEN_WIDTH; j++) {
			plot_pixel(j, i, titlescreen[counter]);
			counter++;
		}

	}

}

void clear_screen() {
	for (int x = 0; x < VGA_x; x++) {
		for (int y = 0; y < VGA_y; y++) {
			plot_pixel(x, y, 0x0);
		}
	}
}

void wait_for_vsync() {
	volatile int* pixel_ctrl_ptr = (int*)0xff203020;
	int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0b01) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
	// should exit when vsync occurs!
}

void plot_pixel(int x, int y, short int line_color) {
	volatile short int* one_pixel_address;

	one_pixel_address = (int) pixel_buffer_start + (y << 10) + (x << 1);

	*one_pixel_address = line_color;
}
